import React from 'react';
import { Box, Pagination } from '@mui/material';

const VenuePagination = ({ totalPages, currentPage, handlePageChange,venues}) => (
  <Box display="flex" justifyContent="center" mt={3}>
    <Pagination
      count={totalPages}
      page={currentPage}
      onChange={(event, value) => {
        console.log(`Page change triggered: ${totalPages} ${venues.length}`); // 调试信息
        handlePageChange(event, value);
      }}
      variant="outlined"
      
    />
  </Box>
);

export default VenuePagination;
